import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

class About extends Component {

  render() {
    return (
      <div className="AboutContainer">
        <div id="aboutText">
          <p>Hi, it's nice to meet you!</p>
          <p>A Virginian at heart, I moved to NYC after graduating from William & Mary, a small liberal arts school in Williamsburg, VA where I studied Accounting and Finance. While working as a project management analyst at a large bank, I started dabbling with code. Soonafter, I quit my job and applied to the Flatiron School to pursue learning to code fulltime.</p>
        </div>
        <div id="downArrow">
          <div className='arrow'><FontAwesomeIcon icon="caret-down"/></div>
        </div>
      </div>
    )
  }
}

export default About
